{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/amirmotefaker/uber-data-analysis-using-r?scriptVersionId=130164263\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# Uber Data Analysis using R\n\n- With over 118 million users, 5 million drivers, and 6.3 billion trips with 17.4 million trips completed per day - Uber is the company behind the data for moving people and making deliveries hassle-free.\n- How are drivers assigned to riders cost-efficiently, and how is dynamic pricing leveraged to balance supply and demand? \n- Thanks to the large volumes of data Uber collects and the fantastic team that handles Uber Data Analysis using Machine Learning tools and frameworks. \n- If youâ€™re curious to learn more about how data analysis is done at Uber to ensure positive experiences for riders while making the ride profitable for the company - Get your hands dirty working with the Uber dataset to gain in-depth insights.\n\n\n- Data storytelling is an important component of Machine Learning through which companies are able to understand the background of various operations. \n- With the help of visualization, companies can avail the benefit of understanding complex data and gaining insights that would help them to craft decisions. \n- This is more of a data visualization project that will guide you towards using the ggplot2 library for understanding the data and for developing an intuition for understanding the customers who avail the trips.\n\n- In this data analysis, we analyze Uber data from 1th April 2014 to 30th September 2014.\n\n- The goal of this project is to learn visualizations in R.\n\n- Dataset: [Kaggle](https://www.kaggle.com/datasets/amirmotefaker/uber-dataset-from-april-to-september-2014)\n\n![image.png](attachment:098e1013-e4f0-4e9d-ab63-9fbf152cbc6e.png)","metadata":{},"attachments":{"098e1013-e4f0-4e9d-ab63-9fbf152cbc6e.png":{"image/png":""}}},{"cell_type":"markdown","source":"# Import Libraries","metadata":{}},{"cell_type":"code","source":"library(ggplot2)\nlibrary(ggthemes)\nlibrary(lubridate)\nlibrary(dplyr)\nlibrary(tidyr)\nlibrary(DT)\nlibrary(scales)\n#library(data.table) # Import big files (CSV or Text) \n#library(readxl) # Import Excel files","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:04:14.686353Z","iopub.execute_input":"2023-05-13T18:04:14.689823Z","iopub.status.idle":"2023-05-13T18:04:15.721818Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Creating vector of colors for the plots","metadata":{}},{"cell_type":"code","source":"colors = c(\"#CC1011\", \"#665555\", \"#05a399\", \"#cfcaca\", \"#f5e840\", \"#0683c9\", \"#e075b0\")\ncolors","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:04:15.725138Z","iopub.execute_input":"2023-05-13T18:04:15.771021Z","iopub.status.idle":"2023-05-13T18:04:15.798563Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Read the data for each month separately","metadata":{}},{"cell_type":"code","source":"apr <- read.csv(\"/kaggle/input/uber-dataset-from-april-to-september-2014/Uber-dataset/uber-raw-data-apr14.csv/uber-raw-data-apr14.csv\")\nmay <- read.csv(\"/kaggle/input/uber-dataset-from-april-to-september-2014/Uber-dataset/uber-raw-data-may14.csv/uber-raw-data-may14.csv\")\njune <- read.csv(\"/kaggle/input/uber-dataset-from-april-to-september-2014/Uber-dataset/uber-raw-data-jun14.csv/uber-raw-data-jun14.csv\")\njuly <- read.csv(\"/kaggle/input/uber-dataset-from-april-to-september-2014/Uber-dataset/uber-raw-data-jul14.csv/uber-raw-data-jul14.csv\")\naug <- read.csv(\"/kaggle/input/uber-dataset-from-april-to-september-2014/Uber-dataset/uber-raw-data-aug14.csv/uber-raw-data-aug14.csv\")\nsept <- read.csv(\"/kaggle/input/uber-dataset-from-april-to-september-2014/Uber-dataset/uber-raw-data-sep14.csv/uber-raw-data-sep14.csv\")\n","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:04:15.802904Z","iopub.execute_input":"2023-05-13T18:04:15.804955Z","iopub.status.idle":"2023-05-13T18:04:33.041861Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Combine the data together","metadata":{}},{"cell_type":"code","source":"data <- rbind(apr, may, june, july, aug, sept)\ncat(\"The dimensions of the data are:\", dim(data))","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:04:33.044354Z","iopub.execute_input":"2023-05-13T18:04:33.045834Z","iopub.status.idle":"2023-05-13T18:04:34.499728Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Print the first 6 rows of the data","metadata":{}},{"cell_type":"code","source":"head(data)","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:04:34.50208Z","iopub.execute_input":"2023-05-13T18:04:34.503511Z","iopub.status.idle":"2023-05-13T18:04:34.529933Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Readable format for the DateTime","metadata":{}},{"cell_type":"code","source":"data$Date.Time <- as.POSIXct(data$Date.Time, format=\"%m/%d/%Y %H:%M:%S\")\ndata$Time <- format(as.POSIXct(data$Date.Time, format = \"%m/%d/%Y %H:%M:%S\"), format=\"%H:%M:%S\")\ndata$Date.Time <- ymd_hms(data$Date.Time)\nhead(data)","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:04:34.532355Z","iopub.execute_input":"2023-05-13T18:04:34.533801Z","iopub.status.idle":"2023-05-13T18:05:05.313342Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Create individual columns for month day and year","metadata":{}},{"cell_type":"code","source":"data$day <- factor(day(data$Date.Time))\ndata$month <- factor(month(data$Date.Time, label=TRUE))\ndata$year <- factor(year(data$Date.Time))\ndata$dayofweek <- factor(wday(data$Date.Time, label=TRUE))\nhead(data)","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:05:05.315823Z","iopub.execute_input":"2023-05-13T18:05:05.317318Z","iopub.status.idle":"2023-05-13T18:05:23.568891Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Add Time variables as well ","metadata":{}},{"cell_type":"code","source":"data$second = factor(second(hms(data$Time)))\ndata$minute = factor(minute(hms(data$Time)))\ndata$hour = factor(hour(hms(data$Time)))\nhead(data)","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:05:23.573676Z","iopub.execute_input":"2023-05-13T18:05:23.576337Z","iopub.status.idle":"2023-05-13T18:05:40.1095Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Data Visualisation","metadata":{}},{"cell_type":"markdown","source":"## Plotting the trips by hours in a day","metadata":{}},{"cell_type":"code","source":"hourly_data <- data %>% \n  group_by(hour) %>% \n  dplyr::summarize(Total = n())","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:05:40.112002Z","iopub.execute_input":"2023-05-13T18:05:40.113434Z","iopub.status.idle":"2023-05-13T18:05:40.241846Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Show data in a searchable js table","metadata":{}},{"cell_type":"code","source":"datatable(hourly_data)","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:05:40.244417Z","iopub.execute_input":"2023-05-13T18:05:40.245833Z","iopub.status.idle":"2023-05-13T18:05:40.497355Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Plot the data by hour","metadata":{}},{"cell_type":"code","source":"ggplot(hourly_data, aes(hour, Total)) + \n  geom_bar(stat=\"identity\", \n           fill=\"steelblue\", \n           color=\"red\") + \n  ggtitle(\"Trips Every Hour\", subtitle = \"aggregated today\") + \n  theme(legend.position = \"none\", \n        plot.title = element_text(hjust = 0.5), \n        plot.subtitle = element_text(hjust = 0.5)) + \n  scale_y_continuous(labels=comma)","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:05:40.500027Z","iopub.execute_input":"2023-05-13T18:05:40.501598Z","iopub.status.idle":"2023-05-13T18:05:41.054741Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Plotting trips by hour and month","metadata":{}},{"cell_type":"code","source":"# Aggregate the data by month and hour\nmonth_hour_data <- data %>% group_by(month, hour) %>%  dplyr::summarize(Total = n())\n\nggplot(month_hour_data, aes(hour, Total, fill=month)) + \n  geom_bar(stat = \"identity\") + \n  ggtitle(\"Trips by Hour and Month\") + \n  scale_y_continuous(labels = comma)","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:05:41.057416Z","iopub.execute_input":"2023-05-13T18:05:41.058941Z","iopub.status.idle":"2023-05-13T18:05:41.924747Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Plotting data by trips during every day of the month","metadata":{}},{"cell_type":"code","source":"# Aggregate data by day of the month \nday_data <- data %>% group_by(day) %>% dplyr::summarize(Trips = n())\nday_data","metadata":{"execution":{"iopub.status.busy":"2023-05-13T18:05:41.928967Z","iopub.execute_input":"2023-05-13T18:05:41.930922Z","iopub.status.idle":"2023-05-13T18:05:42.0698Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Plot the data for the day","metadata":{}},{"cell_type":"code","source":"ggplot(day_data, aes(day, Trips)) + \n  geom_bar(stat = \"identity\", fill = \"steelblue\") +\n  ggtitle(\"Trips by day of the month\") + \n  theme(legend.position = \"none\") + \n  scale_y_continuous(labels